const zipBase64 = ""; // Base64

const zip = new JSZip();
zip.loadAsync(zipBase64, {base64: true})
  .then(zip => {
    return zip.file("dict.js").async("text");
  })
  .then(jsContent => {
    const script = document.createElement('script');
    script.textContent = jsContent;
    document.head.appendChild(script);
  });